import { motion } from 'framer-motion'

export default function Contact() {
    return (
    <motion.div 
        animate={{ rotate: 360 }} 
        transition={{ duration: 1 }}
        exit={{ opacity: 0 }} 
        id="contact-content" 
        className="content">

        CONTACT
    </motion.div> 
  )
}
